# 3342. Find Minimum Time to Reach Last Room II
# https://leetcode.com/problems/find-minimum-time-to-reach-last-room-ii

"""
Description:
There is a dungeon with n x m rooms arranged as a grid.

You are given a 2D array moveTime of size n x m, where moveTime[i][j] represents
the minimum time in seconds when you can start moving to that room. You start 
from the room (0, 0) at time t = 0 and can move to an adjacent room. Moving 
between adjacent rooms takes one second for one move and two seconds for the 
next, alternating between the two.

Return the minimum time to reach the room (n - 1, m - 1).

Two rooms are adjacent if they share a common wall, either horizontally or 
vertically.

Constraints:

2 <= n == moveTime.length <= 750
2 <= m == moveTime[i].length <= 750
0 <= moveTime[i][j] <= 109

Examples:
[[0,4],[4,4]] -> 7
[[0,0,0,0],[0,0,0,0]] -> 6
[[0,1],[1,2]] -> 4 

Intuition:

This seems like a backtracking/dp problem. It would seem useful to have a 
moveCost() method that returned the current delay time (1 or 2) and the moveTime
of the room you are going to. moveCost should take the direction and current
state (which would know what room you were at and the last delay time.)

Delay time = (move % 2) + 1 (where first move is 0)

Also, seems the inherent move delay doesn't affect the path, so it is really
just finding the shortest path, then, if nm is number of moves, adding 
2 * (nm // 2) + (nm + 1) // 2

Further Notes:
It turns out this moveTime is global, that is, you can't go into that room until
the time is at least that. So if you have [ [0, 1], [2, 3] ], you can't go into 
the left room until 1 second is gone by, and you can't go into the lower room 
until 2 seconds goes by. So your shortest path is:

at T=1 (waited a second), spend 1 second to go into (1,0), T == 2
at T=3 (waited another second), spend 2 seconds to go into (1, 1), T == 5

vs
at T=2 (wait 2 seconds), spend 1 second to go into (0, 1), T== 3
at T=3 (no waiting), spend 2 seconds to go into (1, 1)

Further Notes:
- Original solution times out for 700x700 dungeon
- Editorial solution uses visited as well
- Also, great observation that you do not need to track move number,
  can instead base this off position. Start at 0,0, so moves to even
  x+y is 2, moves to odd x+y (0,1) is 2.
- Intuitively, to me, I think of the first sub array as the first row
  of the dungeon, but d[x][y] means that d[x] is the first *column*.
  So I should change my n/m and printDungeon to that model
- The priority queue can handle objects, as long as they have the 'lt'
  method. So making the State helps to clarify the code.
- I had wondered why they need a separate d[][] array for distances as
  they have it in the queue. But they do not have them all. Also, changing
  the .dis in a State that is in the queue does not affect its priority.
- How elegant is that `for dx, dy in dirs:` line! I was thinking I would
  need to make a Dirs class.
- Also: `0 <= nx < n` - didn't know Python could do that!

Some good writeups:
Jinwoo's:
https://leetcode.com/problems/find-minimum-time-to-reach-last-room-ii/solutions/6724340/dijkstra-heaps-with-images-example-walkt-9li9/
https://leetcode.com/discuss/post/6533263/all-about-priority-queues-or-heaps-by-sa-3pd3/
https://leetcode.com/problems/find-minimum-time-to-reach-last-room-ii/solutions/6724514/dijkstras-like-bfs-deep-walkthrough-of-thinking-process-easy-efficient/

"""

from math import inf
from collections import deque
from heapq import heappush as push
from heapq import heappop as pop
import heapq

class State:
    def __init__(self, x, y, dis):
        self.x = x
        self.y = y
        self.dis = dis

    # Required to use in heapq for priority
    def __lt__(self, other):
        return self.dis < other.dis
        
class Room:
    def __init__(self, x, y, t):
        self.x = x
        self.y = y
        self.t = t
    
    def travel(self):
        # travel time *leaving* a room. (0, 0) -> 1, (0,1) -> 2
        return (self.x + self.y) % 2 + 1
    
    def __lt__(self, other):
        return self.t < other.t
        
    def __eq__(self, other):
        return self.x == other.x and self.y == other.y
        
    def __repr__(self):
        return f"Room(x={self.x}, y={self.y}, t={self.t})"

class Solution:
    def minTimeToReach(self, moveTime: list[list[int]]) -> int:
        n = len(moveTime)
        m = len(moveTime[0])
        start_room = Room(0, 0, 0)
        end_room = Room(n - 1, m - 1, inf)
        queue = []
        push(queue, start_room)
        times = [[inf] * m for _ in range(n)]
        times[0][0] = 0
        visited = [[False] * m for _ in range(n)] # Note start_room unvisted
        
        dirs = [(0,1), (1, 0), (0, -1), (-1, 0)]
        while queue:
            room = pop(queue)
            if visited[room.x][room.y]:
               continue
            if room == end_room:
                return times[room.x][room.y]
                
            visited[room.x][room.y] = True
            
            for dx, dy in dirs:
                nx, ny = room.x + dx, room.y + dy
                if not (0 <= nx < n and 0 <= ny < m):
                    continue
                # nt = max() of time where we are or how long to wait (+ travel)
                nt = max(times[room.x][room.y], moveTime[nx][ny]) + room.travel()
                if nt < times[nx][ny]:
                    times[nx][ny] = nt
                    push(queue, Room(nx, ny, nt))
        
        return -1 # Never reached if a solution exists
    
    def minTimeToReachLeetcode(self, moveTime):
        n = len(moveTime)
        m = len(moveTime[0])
        inf = float("inf")
        d = [[inf] * m for _ in range(n)]
        v = [[0] * m for _ in range(n)]

        dirs = [(1, 0), (-1, 0), (0, 1), (0, -1)]

        d[0][0] = 0
        q = []
        heapq.heappush(q, State(0, 0, 0))

        while q:
            s = heapq.heappop(q)
            if v[s.x][s.y]:
                continue
            if s.x == n - 1 and s.y == m - 1:
                break
            v[s.x][s.y] = 1
            for dx, dy in dirs:
                nx, ny = s.x + dx, s.y + dy
                if not (0 <= nx < n and 0 <= ny < m):
                    continue
                dist = max(d[s.x][s.y], moveTime[nx][ny]) + (s.x + s.y) % 2 + 1
                if d[nx][ny] > dist:
                    d[nx][ny] = dist
                    heapq.heappush(q, State(nx, ny, dist))

        return d[n - 1][m - 1]
        
    # Original solution: correct, but 500x slower for 700x700 dungeon
    def minTimeToReachV1(self, moveTime: list[list[int]]) -> int:
        def travel(node, direction):
            dest = (node[0] + direction[0], node[1] + direction[1])
            if dest[0] < 0 or dest[0] > n-1 or dest[1] < 0 or dest[1] > m-1:
                return None
            # print(f"From {node}, going to {dest} - bounds {[n-1,m-1]}")
            return dest
        def neighbors(node):
            neighbors = []
            for direction in directions:
                neighbor = travel(node, direction)
                if neighbor: neighbors.append(neighbor)
            return neighbors

        # printDungeon(moveTime)
        
        start_node = (0, 0)
        n = len(moveTime[0])
        m = len(moveTime)
        end_node = (n - 1, m - 1)
        queue = []
        push(queue, ( (start_node, 0), 0 )) # (node, move_no), time
        times = [[inf] * n for _ in range(m)]
        times[0][0] = 0
        visited = [[False] * n for _ in range(m)]
        visited[0][0] = True
        
        directions = [(0,1), (1, 0), (0, -1), (-1, 0)]
        while queue:
            (node, move_no), time = pop(queue)
            if visited[node[0]][node[1]] == 23:
                continue
            if node == end_node:
                return times[node[1]][node[0]]
            visited[node[0]][node[1]] = True
            
            for neighbor in neighbors(node):
                wait_time = max(time, moveTime[neighbor[1]][neighbor[0]])
                travel_time = (move_no % 2) + 1
                new_time = wait_time + travel_time
                if new_time < times[neighbor[1]][neighbor[0]]:
                    times[neighbor[1]][neighbor[0]] = new_time
                    push(queue, ( (neighbor, move_no+1), new_time ))
        
        return -1
        
def printDungeon(d):
    # d[x][y] implies d[x] is a column
    n = len(d) # columns
    m = len(d[0]) # rows
    print(f"{n} x {m} dungeon:")
    print("Start")
    print("  |")
    print("  âŒ„")
    for y in range(m):
        for x in range(n):
            print(f"{d[x][y]:3}...", end="|")
        if y != m-1: print() # newline except for end
    print(" <- End")
    print()

